const TenantDashboard = () => {
  const { user, profile, logout, logActivity } = useAuth();
  const [stats, setStats] = useState({
    totalUsers: 0,
    activeSessions: 0,
    createdDate: null,
    lastLogin: null
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    if (profile) {
      fetchDashboardStats();
    }
  }, [profile]);

  const fetchDashboardStats = async () => {
    try {
      // Fetch total users in tenant
      const { count: userCount } = await supabase
        .from('profiles')
        .select('*', { count: 'exact', head: true })
        .eq('tenant_id', profile.tenant_id);

      // Fetch active sessions
      const { count: sessionCount } = await supabase
        .from('user_sessions')
        .select('*', { count: 'exact', head: true })
        .eq('tenant_id', profile.tenant_id)
        .eq('is_active', true);

      // Fetch tenant creation date
      const { data: tenantData } = await supabase
        .from('tenants')
        .select('created_at')
        .eq('id', profile.tenant_id)
        .single();

      setStats({
        totalUsers: userCount || 0,
        activeSessions: sessionCount || 0,
        createdDate: tenantData?.created_at,
        lastLogin: profile.last_login
      });
    } catch (error) {
      console.error('Error fetching dashboard stats:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleButtonClick = async (action, description) => {
    if (user && profile) {
      await logActivity(user.id, profile.tenant_id, 'view', 'dashboard', action, description);
    }
  };

  const formatDate = (dateString) => {
    if (!dateString) return 'N/A';
    return new Date(dateString).toLocaleDateString();
  };

  if (!profile) {
    return (
      <div className="container">
        <div style={{ textAlign: 'center', padding: '50px' }}>
          <h2>Loading profile...</h2>
        </div>
      </div>
    );
  }

  return (
    <div className="container">
      <div className="dashboard">
        <div className="dashboard-header">
          <div>
            <h1>Welcome, {profile.full_name}!</h1>
            <p>Company Dashboard - {profile.tenants?.company_name}</p>
          </div>
          <button className="logout-btn" onClick={logout}>
            Logout
          </button>
        </div>

        <div className="dashboard-content">
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', gap: '20px', marginBottom: '20px' }}>
            <div style={{ background: '#f8f9fa', padding: '20px', borderRadius: '8px', border: '1px solid #e1e5e9' }}>
              <h3 style={{ marginBottom: '10px', color: '#333' }}>Company Information</h3>
              <p><strong>Company:</strong> {profile.tenants?.company_name}</p>
              <p><strong>Admin Name:</strong> {profile.full_name}</p>
              <p><strong>Email:</strong> {profile.email}</p>
              <p><strong>Role:</strong> {profile.role}</p>
              <p><strong>Subscription:</strong> {profile.tenants?.subscription_plan}</p>
            </div>

            <div style={{ background: '#f8f9fa', padding: '20px', borderRadius: '8px', border: '1px solid #e1e5e9' }}>
              <h3 style={{ marginBottom: '10px', color: '#333' }}>User Management</h3>
              <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
                <button 
                  className="btn btn-secondary"
                  onClick={() => handleButtonClick('manage_users', 'Viewed user management')}
                >
                  Manage Users
                </button>
                <button 
                  className="btn btn-secondary"
                  onClick={() => handleButtonClick('add_user', 'Viewed add user form')}
                >
                  Add New User
                </button>
                <button 
                  className="btn btn-secondary"
                  onClick={() => handleButtonClick('user_permissions', 'Viewed user permissions')}
                >
                  User Permissions
                </button>
              </div>
            </div>

            <div style={{ background: '#f8f9fa', padding: '20px', borderRadius: '8px', border: '1px solid #e1e5e9' }}>
              <h3 style={{ marginBottom: '10px', color: '#333' }}>Company Stats</h3>
              <div style={{ color: '#666' }}>
                <p>• Total Users: {loading ? '...' : stats.totalUsers}</p>
                <p>• Active Sessions: {loading ? '...' : stats.activeSessions}</p>
                <p>• Company Created: {formatDate(stats.createdDate)}</p>
                <p>• Last Login: {formatDate(stats.lastLogin)}</p>
              </div>
            </div>

            <div style={{ background: '#f8f9fa', padding: '20px', borderRadius: '8px', border: '1px solid #e1e5e9' }}>
              <h3 style={{ marginBottom: '10px', color: '#333' }}>Company Settings</h3>
              <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
                <button 
                  className="btn btn-secondary"
                  onClick={() => handleButtonClick('company_profile', 'Viewed company profile')}
                >
                  Company Profile
                </button>
                <button 
                  className="btn btn-secondary"
                  onClick={() => handleButtonClick('security_settings', 'Viewed security settings')}
                >
                  Security Settings
                </button>
                <button 
                  className="btn btn-secondary"
                  onClick={() => handleButtonClick('billing', 'Viewed billing & plans')}
                >
                  Billing & Plans
                </button>
              </div>
            </div>

            <div style={{ background: '#f8f9fa', padding: '20px', borderRadius: '8px', border: '1px solid #e1e5e9' }}>
              <h3 style={{ marginBottom: '10px', color: '#333' }}>Reports & Analytics</h3>
              <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
                <button 
                  className="btn btn-secondary"
                  onClick={() => handleButtonClick('activity_report', 'Viewed user activity report')}
                >
                  User Activity Report
                </button>
                <button 
                  className="btn btn-secondary"
                  onClick={() => handleButtonClick('usage_analytics', 'Viewed usage analytics')}
                >
                  Usage Analytics
                </button>
                <button 
                  className="btn btn-secondary"
                  onClick={() => handleButtonClick('export_data', 'Exported data')}
                >
                  Export Data
                </button>
              </div>
            </div>

            <div style={{ background: '#f8f9fa', padding: '20px', borderRadius: '8px', border: '1px solid #e1e5e9' }}>
              <h3 style={{ marginBottom: '10px', color: '#333' }}>Support & Help</h3>
              <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
                <button 
                  className="btn btn-secondary"
                  onClick={() => handleButtonClick('contact_support', 'Contacted support')}
                >
                  Contact Support
                </button>
                <button 
                  className="btn btn-secondary"
                  onClick={() => handleButtonClick('admin_guide', 'Viewed admin guide')}
                >
                  Admin Guide
                </button>
                <button 
                  className="btn btn-secondary"
                  onClick={() => handleButtonClick('api_docs', 'Viewed API documentation')}
                >
